CREATE TABLE IF NOT EXISTS `SkillTreeResource` (
	`job_id` int(11) NOT NULL,
	`skill_id` int(11) NOT NULL,
	`min_skill_lv` int(11) NOT NULL,
	`max_skill_lv` int(11) NOT NULL,
	`lv` int(11) NOT NULL,
	`job_lv` int(11) NOT NULL,
	`jp_ratio` decimal(10, 2) NOT NULL,
	`need_skill_id_1` int(11) NOT NULL,
	`need_skill_lv_1` int(11) NOT NULL,
	`need_skill_id_2` int(11) NOT NULL,
	`need_skill_lv_2` int(11) NOT NULL,
	`need_skill_id_3` int(11) NOT NULL,
	`need_skill_lv_3` int(11) NOT NULL
) ENGINE=MyISAM;

